import Header from "./Componentes/header";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Header/>

      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />}>
              <Route path="/form" element={<Formulario />} />
          </Route>
        </Routes>
      </BrowserRouter>
      </div>
  );

}

export default App;
